request.description:
This API endpoint sends an HTTP GET request to retrieve exams related to a specific subject for a user in a college. The request should include the 'college_uuid' and 'subject_uuid' as query parameters. The response will be in JSON format with an array of exam data, including question text and answers. Additionally, the response will include a status indicating success or failure, a message if applicable, and the status code.

Example:

``` http
GET http://derrebni-3lwatany.test/api/user/exams/subject?college_uuid=06ae1f82-8df5-413f-bddb-bc2c1fc6ea51&subject_uuid=661bff2b-c2a9-4fcc-8ea2-b3958eb40a5e

